function AddDataModal({ onClose, onAddData }) {
  if (!onClose || typeof onClose !== "function") {
    console.error("onClose is not a function or missing.");
    return null; // 문제가 있으면 렌더링하지 않음
  }

  return (
    <div className="modal">
      <div className="modal-content">
        <span className="close" onClick={onClose}>
          &times;
        </span>
        <h3>데이터 추가</h3>
        <AddDataForm onAddData={onAddData} onClose={onClose} />
      </div>
    </div>
  );
}
